// components/HomePage/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import "../../styles/HomePage/Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src="/assets/HomePage/logo.svg" alt="AyuRaksha Logo" />
        <span className="logo-text">AyuRaksha</span>
      </div>
      <ul className="navbar-links">
        <li><a href="#services">Services</a></li>
        <li><a href="#why-choose">Why Us</a></li>
        <li><a href="#how-it-works">How It Works</a></li>
        <li><a href="#testimonials">Testimonials</a></li>
        <li><a href="#footer">Contact</a></li>
      </ul>
      <div className="navbar-actions">
        <Link to="/login" className="btn-login">Login</Link>
        <Link to="/register/patient" className="btn-appointment">Book Appointment</Link>
      </div>
    </nav>
  );
};

export default Navbar;
